llID] then","        local ret","        if prof[1] and prof[1] > 0 then","            if prof[1] and prof[8] then","                ret = { { prof[1], prof[8] } }","            else","                ret = { prof[1] }","            end","\t\telse","\t\t\tret = {}","        end","        local recipe = Recipe.GetRecipeForSpell(spellID)","        if recipe then","            ret[#ret+1] = recipe","            ret[#ret+1] = 0","        elseif #ret > 0 then","            ret[#ret+1] = 0","        end","\t\tret[#ret+1] = \"prof\"..spellID","\t\tfor i = 1, #prof[6] do","\t\t\tret[#ret+1] = {prof[6][i], prof[7][i]}","\t\tend","\t\tProfessionCache[spellID] = ret","    end","","    return ProfessionCache[spellID]","end","","function Profession.GetCreatedItemID(spellID)","\treturn PROFESSION[spellID or 0] and PROFESSION[spellID or 0][1] or nil","end","","function Profession.GetNumCreatedItems(spellID)","\treturn PROFESSION[spellID or 0] and ( PROFESSION[spellID or 0][8] or 1 ) or nil","end","","function Profession.GetSpellDescription(spellID)","\treturn ( spellID and PROFESSION[spellID] ) and PROFESSION_TEXT[PROFESSION[spellID][2] or PROFESSION_DEFAULT] or nil","end","","function Profession.GetSpellDescriptionShort(spellID)","\treturn ( spellID and PROFESSION[spellID] ) and PROFESSION_TEXT_SHORT[PROFESSION[spellID][2] or PROFESSION_DEFAULT] or nil","end","","function Profession.GetColorSkillRankNoSpell(min, low, high)","    return min <= 0 and format(FORMAT_STRING_SKILL2, low, ((high - low) * 0.5)+low, high) or format(FORMAT_STRING_SKILL, min, low, ((high - low) * 0.5)+low, high)","end","","function Profession.GetColorSkillRank(spellID)","    local spell = Profession.GetProfessionData(spellID)","    if not spell then return end","    return  Profession.GetColorSkillRankNoSpell(spell[3], spell[4], spell[5]) --format(FORMAT_STRING_SKILL, spell[3], spell[4], ((spell[5] - spell[4]) * 0.5)+spell[4], spell[5])","end","","function Profession.GetSpellDescriptionWithRank(spellID, shortName)","    if not spellID or not PROFESSION[spellID] then return end","\tif shortName then","\t\treturn Profession.GetSpellDescriptionShort(spellID)..\"  \"..(Profession.GetColorSkillRank(spellID) or \"\")","\telse","\t\treturn Profession.GetSpellDescription(spellID)..\"  \"..(Profession.GetColorSkillRank(spellID) or \"\")","\tend","end","","function Profession.GetColorSkillRankItem(itemID)","    local itemData = PROFESSION_ITEM_SKILL[itemID or 0]","    if not itemData then return end","    return  Profession.GetColorSkillRankNoSpell(itemData[1], itemData[2], itemData[3]) --format(FORMAT_STRING_SKILL, spell[3], spell[4], ((spell[5] - spell[4]) * 0.5)+spell[4], spell[5])","end","","function Profession.GetIcon(spellID)","    local prof = Profession.GetProfessionData(spellID)","    if not prof then return PROFESSION_ICON[0] end","    return PROFESSION_ICON[prof[2] or 0] or PROFESSION_ICON[0]","end","","function Profession.GetSpellIDPhase(spellID)","    if not PROFESSION[spellID] then return end","    if not ContentPhaseCache[spellID] then","        local content = PROFESSION[spellID][6]","        local recipe = Recipe.GetRecipeForSpell(spellID)","        local phase = recipe and ContentPhase:GetForItemID(recipe) or 0","        local createdItemPhase = ContentPhase:GetForItemID(PROFESSION[spellID][1])","        phase = ( createdItemPhase and createdItemPhase > phase ) and createdItemPhase or phase","        for i = 1, #content do","            local c = ContentPhase:GetForItemID(content[i])","            phase = ( c and c > phase ) and c or phase","        end","","        ContentPhaseCache[spellID] = phase","    end","    return ContentPhaseCache[spellID]","end","","function Profession.GetPhaseTextureForSpellID(spellID)","    local phase = ContentPhaseCache[spellID] or Profession.GetSpellIDPhase(spellID)","    if not phase then return end","    return ContentPhase:GetPhaseTexture(phase)","end","","function Profession.GetProfessionID(spellID)","    return PROFESSION[